import * as types from '../constants/ActionTypes'
var initalState = {
                filterName: '',
            filterStatus: -1
};

export var filtertable = (state = initalState, action) => {
    switch (action.type) {
        case types.FILTER_TABLE:
            return state;
        default: return state;
    }
}
